import React from "react";
import { Card, CardContent, Typography, Button } from "@mui/material";

const jobPosts = [
  { id: 1, title: "Full Stack Developer", description: "Build web apps.", salary: "$120K" },
  { id: 2, title: "Data Scientist", description: "Analyze data.", salary: "$110K" },
];

const JobListings = () => {
  return (
    <div style={{ textAlign: "center", marginTop: "50px" }}>
      <h1>Job Listings</h1>
      {jobPosts.map((job) => (
        <Card key={job.id} style={{ maxWidth: 600, margin: "20px auto" }}>
          <CardContent>
            <Typography variant="h5">{job.title}</Typography>
            <Typography>{job.description}</Typography>
            <Typography>Salary: {job.salary}</Typography>
            <Button variant="contained" style={{ marginTop: "10px" }}>
              Apply
            </Button>
          </CardContent>
        </Card>
      ))}
    </div>
  );
};

export default JobListings;
